import React from "react";
import Data from "./data";

const List = () => {
    const people = Data;
    return (
        <>
            {people.map((person) => {
                const { id, name, age, image } = person;
                return (
                    <>
                        <section className="person" key={id}>
                            <h4>{name}</h4>
                            <img src={image} alt="" />
                            <p>{age} years</p>
                        </section>
                    </>
                );
            })}
        </>
    );
};

export default List;
